gseq____&quot;^Ulogseq____&quot;,1990,536870976]],[logseq____&quot;^15logseq____&quot;,[1993,logseq____&quot;^Hlogseq____&quot;,1990,536870976]],[logseq____&quot;^15logseq____&quot;,[1993,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u67503913-ea88-4459-b6bc-1c8a501befc8logseq____&quot;,536870976]],[logseq____&quot;^15logseq____&quot;,[1994,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is Silhouette. Its a melancholy, atmospheric track with hints of 80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. Silhouette is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. Its slow and steady and it grows. I think the beauty lies in the simplicity of it.logseq____&quot;,536870976]],[logseq____&quot;^15logseq____&quot;,[1994,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870976]],[logseq____&quot;^15logseq____&quot;,[1994,logseq____&quot;^Flogseq____&quot;,1993,536870976]],[logseq____&quot;^15logseq____&quot;,[1994,logseq____&quot;^Xlogseq____&quot;,202,536870976]],[logseq____&quot;^15logseq____&quot;,[1994,logseq____&quot;^Vlogseq____&quot;,202,536870976]],[logseq____&quot;^15logseq____&quot;,[1994,logseq____&quot;^Ulogseq____&quot;,202,536870976]],[logseq____&quot;^15logseq____&quot;,[1994,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u67503913-9181-4fd9-9719-c0b9fccab4eclogseq____&quot;,536870976]],[logseq____&quot;^15logseq____&quot;,[1995,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Club music will always be at the core of Yottos work, but his ambient catalogue will no longer sit in the shadows. Together, these parallel forms of expression dont dilute Yottos artistry; they make it       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
